import React from 'react';

const Support = () => (
  <div className="p-8">
    <h2 className="text-2xl font-bold mb-4">Support & FAQs</h2>
    <p><strong>Q:</strong> How do I apply for a loan?<br/><strong>A:</strong> Visit our services page and fill out the relevant form.</p>
    <p><strong>Q:</strong> What documents are required?<br/><strong>A:</strong> ID proof, address proof, and income proof.</p>
  </div>
);

export default Support;
